  return (
    <div>
      <div className='bg-earth bg-no-repeat bg-fixed min-h-screen'>

      </div>
      <style jsx>{`
        .bg-earth {
          background-image: url("/assets/static/earth.jpg");
          filter: hue-rotate(180deg)
        }
      `}</style>
    </div>
  )
}
